// List calls ListFunc.
func (mock *DaemonSetCacheMock) List(namespace string, selector labels.Selector) ([]*v1a.DaemonSet, error) {
	if mock.ListFunc == nil {
		panic("DaemonSetCacheMock.ListFunc: method is nil but DaemonSetCache.List was just called")
	}
	callInfo := struct {
		Namespace string
		Selector  labels.Selector
	}{
		Namespace: namespace,
		Selector:  selector,
	}
	lockDaemonSetCacheMockList.Lock()
	mock.calls.List = append(mock.calls.List, callInfo)
	lockDaemonSetCacheMockList.Unlock()
	return mock.ListFunc(namespace, selector)
}

// ListCalls gets all the calls that were made to List.
// Check the length with:
//     len(mockedDaemonSetCache.ListCalls())
func (mock *DaemonSetCacheMock) ListCalls() []struct {
	Namespace string
	Selector  labels.Selector
} {
	var calls []struct {
		Namespace string
		Selector  labels.Selector
	}
	lockDaemonSetCacheMockList.RLock()
	calls = mock.calls.List
	lockDaemonSetCacheMockList.RUnlock()
	return calls
}
